// Ganti seluruh isi file frontend/src/pages/Submissions.jsx dengan kode ini:

import React, { useState, useEffect } from 'react';
import { useAuth } from '../contexts/AuthContext';

const Submissions = () => {
    const { user } = useAuth();
    const [submissions, setSubmissions] = useState([]);
    const [loading, setLoading] = useState(true);
    const [filter, setFilter] = useState('all');
    const [showCreateForm, setShowCreateForm] = useState(false);
    const [alert, setAlert] = useState(null);
    const [formData, setFormData] = useState({
        type: 'MATERIAL',
        title: '',
        content: '',
        fileUrl: ''
    });

    // Mock data - replace with actual API calls
    const mockSubmissions = [
        {
            submissionId: 1,
            type: 'FASILITAS',
            title: 'Laboratorium Penelitian',
            content: 'Laboratorium Penelitian untuk percobaan menarik',
            status: 'PENDING',
            submittedAt: '2025-06-15T11:28:00Z',
            fileUrl: null
        },
        {
            submissionId: 2,
            type: 'FASILITAS',
            title: 'Student Collaborative Space',
            content: 'Proposal for modern collaborative workspace for student projects.',
            status: 'REJECTED',
            submittedAt: '2025-06-15T08:55:00Z',
            fileUrl: '#'
        },
        {
            submissionId: 3,
            type: 'MATERIAL',
            title: 'Introduction to Machine Learning',
            content: 'Comprehensive educational material covering fundamental concepts of machine learning.',
            status: 'PENDING',
            submittedAt: '2025-06-15T08:55:00Z',
            fileUrl: '#'
        }
    ];

    useEffect(() => {
        loadSubmissions();
    }, []);

    const loadSubmissions = async () => {
        setLoading(true);
        try {
            // Simulate API call
            await new Promise(resolve => setTimeout(resolve, 1000));
            setSubmissions(mockSubmissions);
        } catch (error) {
            console.error('Error loading submissions:', error);
            setAlert({ type: 'error', message: 'Failed to load submissions' });
        } finally {
            setLoading(false);
        }
    };

    const handleCreateSubmission = () => {
        setShowCreateForm(true);
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData(prev => ({
            ...prev,
            [name]: value
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            // Simulate API call
            await new Promise(resolve => setTimeout(resolve, 1000));
            setAlert({ type: 'success', message: 'Submission created successfully!' });
            setShowCreateForm(false);
            setFormData({ type: 'MATERIAL', title: '', content: '', fileUrl: '' });
            loadSubmissions();
        } catch (error) {
            setAlert({ type: 'error', message: 'Failed to create submission' });
        }
    };

    const getStats = () => {
        const total = submissions.length;
        const pending = submissions.filter(s => s.status === 'PENDING').length;
        const approved = submissions.filter(s => s.status === 'APPROVED').length;
        const rejected = submissions.filter(s => s.status === 'REJECTED').length;

        return { total, pending, approved, rejected };
    };

    const filteredSubmissions = submissions.filter(submission => {
        switch (filter) {
            case 'pending':
                return submission.status === 'PENDING';
            case 'approved':
                return submission.status === 'APPROVED';
            case 'rejected':
                return submission.status === 'REJECTED';
            case 'material':
                return submission.type === 'MATERIAL';
            case 'fasilitas':
                return submission.type === 'FASILITAS';
            default:
                return true;
        }
    });

    const formatDate = (dateString) => {
        const date = new Date(dateString);
        return date.toLocaleDateString('en-US', {
            year: 'numeric',
            month: 'long',
            day: 'numeric'
        });
    };

    const stats = getStats();

    if (loading) {
        return (
            <div className="submissions-loading">
                <div className="loading-content">
                    <div className="loading-spinner"></div>
                    <p>Loading submissions...</p>
                </div>
            </div>
        );
    }

    return (
        <div className="submissions-page">
            <div className="submissions-container">
                {/* Header */}
                <div className="submissions-header">
                    <div className="header-content">
                        <h1>My Submissions</h1>
                        <p>Track your material and facility submissions</p>
                    </div>
                    <div className="header-actions">
                        <button className="btn btn-primary" onClick={handleCreateSubmission}>
                            <i className="fas fa-plus"></i>
                            New Submission
                        </button>
                    </div>
                </div>

                {/* Stats */}
                <div className="submissions-stats">
                    <div className="stat-item">
                        <span className="stat-number">{stats.total}</span>
                        <span className="stat-label">Total Submissions</span>
                    </div>
                    <div className="stat-item">
                        <span className="stat-number">{stats.pending}</span>
                        <span className="stat-label">Pending</span>
                    </div>
                    <div className="stat-item">
                        <span className="stat-number">{stats.approved}</span>
                        <span className="stat-label">Approved</span>
                    </div>
                    <div className="stat-item">
                        <span className="stat-number">{stats.rejected}</span>
                        <span className="stat-label">Rejected</span>
                    </div>
                </div>

                {/* Alert */}
                {alert && (
                    <div className={`alert alert-${alert.type}`}>
                        <i className={`fas ${alert.type === 'success' ? 'fa-check-circle' : 'fa-exclamation-triangle'}`}></i>
                        {alert.message}
                        <button className="alert-close" onClick={() => setAlert(null)}>×</button>
                    </div>
                )}

                {/* Filters */}
                <div className="submissions-filters">
                    <div className="filter-tabs">
                        <button
                            className={`filter-tab ${filter === 'all' ? 'active' : ''}`}
                            onClick={() => setFilter('all')}
                        >
                            <i className="fas fa-list"></i>
                            All Submissions
                        </button>
                        <button
                            className={`filter-tab ${filter === 'pending' ? 'active' : ''}`}
                            onClick={() => setFilter('pending')}
                        >
                            <i className="fas fa-clock"></i>
                            Pending
                        </button>
                        <button
                            className={`filter-tab ${filter === 'approved' ? 'active' : ''}`}
                            onClick={() => setFilter('approved')}
                        >
                            <i className="fas fa-check"></i>
                            Approved
                        </button>
                        <button
                            className={`filter-tab ${filter === 'rejected' ? 'active' : ''}`}
                            onClick={() => setFilter('rejected')}
                        >
                            <i className="fas fa-times"></i>
                            Rejected
                        </button>
                    </div>
                </div>

                {/* Create Form Modal */}
                {showCreateForm && (
                    <div className="modal-overlay" onClick={() => setShowCreateForm(false)}>
                        <div className="modal-content" onClick={(e) => e.stopPropagation()}>
                            <div className="modal-header">
                                <h3>Create New Submission</h3>
                                <button className="modal-close" onClick={() => setShowCreateForm(false)}>×</button>
                            </div>
                            <form onSubmit={handleSubmit} className="modal-body">
                                <div className="form-group">
                                    <label htmlFor="type" className="form-label">Type</label>
                                    <select
                                        className="form-control"
                                        id="type"
                                        name="type"
                                        value={formData.type}
                                        onChange={handleInputChange}
                                        required
                                    >
                                        <option value="MATERIAL">Material</option>
                                        <option value="FASILITAS">Fasilitas</option>
                                    </select>
                                </div>
                                <div className="form-group">
                                    <label htmlFor="title" className="form-label">Title</label>
                                    <input
                                        type="text"
                                        className="form-control"
                                        id="title"
                                        name="title"
                                        value={formData.title}
                                        onChange={handleInputChange}
                                        required
                                    />
                                </div>
                                <div className="form-group">
                                    <label htmlFor="content" className="form-label">Description</label>
                                    <textarea
                                        className="form-control"
                                        id="content"
                                        name="content"
                                        rows="4"
                                        value={formData.content}
                                        onChange={handleInputChange}
                                    ></textarea>
                                </div>
                                <div className="form-group">
                                    <label htmlFor="fileUrl" className="form-label">File URL (Optional)</label>
                                    <input
                                        type="url"
                                        className="form-control"
                                        id="fileUrl"
                                        name="fileUrl"
                                        value={formData.fileUrl}
                                        onChange={handleInputChange}
                                    />
                                </div>
                                <div className="modal-actions">
                                    <button type="button" className="btn btn-outline" onClick={() => setShowCreateForm(false)}>
                                        Cancel
                                    </button>
                                    <button type="submit" className="btn btn-primary">
                                        Create Submission
                                    </button>
                                </div>
                            </form>
                        </div>
                    </div>
                )}

                {/* Submissions Grid */}
                <div className="submissions-grid">
                    {filteredSubmissions.length === 0 ? (
                        <div className="empty-state">
                            <div className="empty-icon">
                                <i className="fas fa-inbox"></i>
                            </div>
                            <h3>No submissions found</h3>
                            <p>You haven't created any submissions yet. Create your first submission to get started!</p>
                            <button className="btn btn-primary" onClick={handleCreateSubmission}>
                                <i className="fas fa-plus"></i>
                                Create First Submission
                            </button>
                        </div>
                    ) : (
                        filteredSubmissions.map((submission) => (
                            <div
                                key={submission.submissionId}
                                className={`submission-card ${submission.status.toLowerCase()}`}
                            >
                                <div className="submission-card-header">
                                    <div className="submission-badges">
                                        <span className={`badge badge-${submission.type.toLowerCase()}`}>
                                            {submission.type}
                                        </span>
                                        <span className={`badge badge-${submission.status.toLowerCase()}`}>
                                            {submission.status}
                                        </span>
                                    </div>
                                    <div className="submission-meta">
                                        <span className="submission-date">
                                            {formatDate(submission.submittedAt)}
                                        </span>
                                    </div>
                                </div>

                                <div className="submission-card-content">
                                    <h3 className="submission-title">{submission.title}</h3>
                                    <p className="submission-type">
                                        <i className={`fas ${submission.type === 'MATERIAL' ? 'fa-book' : 'fa-building'}`}></i>
                                        {submission.type === 'MATERIAL' ? 'Research Material' : 'Facility Request'}
                                    </p>
                                    <p className="submission-excerpt">{submission.content}</p>
                                </div>

                                <div className="submission-card-actions">
                                    <div className="submission-status">
                                        <i className={`fas ${
                                            submission.status === 'PENDING' ? 'fa-clock' :
                                                submission.status === 'APPROVED' ? 'fa-check-circle' : 'fa-times-circle'
                                        }`}></i>
                                        <span>{submission.status}</span>
                                    </div>
                                    <div className="submission-actions">
                                        {submission.fileUrl && (
                                            <a
                                                href={submission.fileUrl}
                                                target="_blank"
                                                rel="noopener noreferrer"
                                                className="btn-view"
                                            >
                                                <i className="fas fa-external-link-alt"></i>
                                                View File
                                            </a>
                                        )}
                                        <button className="btn-details">
                                            <i className="fas fa-info-circle"></i>
                                            Details
                                        </button>
                                    </div>
                                </div>
                            </div>
                        ))
                    )}
                </div>
            </div>
        </div>
    );
};

export default Submissions;
